import { useState } from 'react'


export default (props) => {
    const [count, setCount] = useState(0)

    return (<div>
        <h3>{count}</h3>
        <button onClick={() => setCount(count + 1)}>INC</button>
        <button onClick={() => setCount(count - 1)}>DEC</button>
    </div>)
}
